subplot(2,1,1);
xrange = 9500:10500;
[f, x] = hist(noLoadTimes,xrange);
bar(x, f/sum(f)/(x(2)-x(1)));title('PDF no load');
subplot(2,1,2);
xrange = 9500:10500;
[f, x] = hist(LoadTimes,xrange);
bar(x, f/sum(f)/(x(2)-x(1)));title('PDF with load');
